import React, { Component } from 'react'
import { Link } from 'react-router-dom'



export default class Home extends Component {
    render() {
        return (
             <div className='container'>
                <div className='pt-5 text-center'>
                    <h2>Welcome to my React Shop!</h2>

                    <br />
                    <Link to='/products'>
                    <img src="https://res.cloudinary.com/practicaldev/image/fetch/s--SXWRB91l--/c_imagga_scale,f_auto,fl_progressive,h_420,q_auto,w_1000/https://dev-to-uploads.s3.amazonaws.com/uploads/articles/iq9r5pa6fmb2n5rfcvq4.jpg" className='img-fluid rounded-circle' to='/products' alt='react' />
                    </ Link>
                    <span className="small">
                        Created by: George Garcia, OCT 2021
                    </span>
                </div>
            </div>
        )
    }
}
